import React from "react";
import { Link } from "react-router-dom";
import { useState } from "react";

//add md:flex to first ul
const Navbar = () => {

    const [toggle, setToggle] = useState(false);

    const handleToggle = () =>{
      setToggle(!toggle)
    }

    return ( 
        <div className='bg-[#71AC57] flex justify-between items-center h-24 mx-auto px-4 text-white'>
        <img className="w-[250px] h-[90px]" src="./Recrash.png" alt="" />
        <ul className='hidden  '>
          <li className='p-4 mr-10 text-3xl font-bold cursor-pointer hover:text-[#38761D]'>Home</li>
          <li className='p-4 mr-10 text-3xl font-bold cursor-pointer hover:text-[#38761D]'>Map</li>
          <li className='p-4 mr-10 text-3xl font-bold cursor-pointer hover:text-[#38761D]'>About</li>
        </ul>


        <div>
          <img className="w-[50px] h-[50px] cursor-pointer" src="./menu.png" alt="" />
        </div>
        
        <div className="fixed left-0 top-0 h-full w-[50%] text-left bg-[#71AC57]">
            
            <ul className="pt-[95px] uppercase">
              <li className='p-4 ml-14 text-3xl border-b border-lime-900 font-bold cursor-pointer hover:text-[#38761D] pt-[40px]'>Home</li>
              <li className='p-4 ml-14 text-3xl font-bold cursor-pointer hover:text-[#38761D] pt-[60px]'>Map</li>
              <li className='p-4 ml-14 text-3xl font-bold cursor-pointer hover:text-[#38761D] pt-[60px]'>About</li>
            </ul>

        </div> 


        </div>
     );
}
 
export default Navbar;
